CREATE TABLE IF NOT EXISTS "barangayPolygons" (
    "barangayId" VARCHAR(16) UNIQUE NOT NULL,
    "barangayName" VARCHAR(255) NOT NULL,
    "polygon" GEOMETRY(MULTIPOLYGON,4326) NOT NULL,
    "centroid" VARCHAR(255) NOT NULL,
    PRIMARY KEY ("barangayId")
);

CREATE OR REPLACE FUNCTION get_barangay(
    IN p_name VARCHAR(255)
)
RETURNS table (
    "barangayId" VARCHAR(16),
	"barangayName" VARCHAR(255),
	"polygon" TEXT,
    "centroid" VARCHAR(255)
)
LANGUAGE plpgsql
as $$
BEGIN
    RETURN QUERY
    SELECT "barangayPolygons"."barangayId", "barangayPolygons"."barangayName", ST_AsText("barangayPolygons"."polygon"), "barangayPolygons"."centroid"
    FROM "barangayPolygons"
    WHERE "barangayPolygons"."barangayName" = p_name;
END;
$$;

